import logo from './logo.svg';
import './App.css';

//Importamos los componentes
import CompMostrarClientes from './clientes/MostrarClientes';
import CompAgregarClientes from './clientes/CrearClientes';


//Importamos el router
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<CompMostrarClientes />} />
          <Route path='/agregar' element={<CompAgregarClientes />} />
          <Route path='/editar/' element={<CompAgregarClientes />} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
